"use client"

import { cn } from "@/lib/utils"

type AgentState = "disconnected" | "connecting" | "connected" | "disconnecting" | "speaking" | null

const DEFAULT_AGENT = {
  name: "OyaTalk Agent",
  description: "AI Voice Assistant",
}

export function OrbVisualization({ agentState }: { agentState: AgentState }) {
  return (
    <div className="flex flex-col items-center gap-3">
      <div className="relative flex items-center justify-center">
        {/* Outer glow halo */}
        <div
          className={cn(
            "absolute inset-0 rounded-full blur-3xl transition-all duration-300",
            agentState === "connected" && "animate-pulse",
            agentState === "speaking" && "animate-bounce",
          )}
          style={{
            background:
              agentState === "connected"
                ? "radial-gradient(circle, rgba(100, 180, 255, 0.4), transparent)"
                : "radial-gradient(circle, rgba(100, 180, 255, 0.1), transparent)",
            width: "280px",
            height: "280px",
          }}
        />

        {/* Middle shimmer layer */}
        <div
          className={cn("absolute rounded-full transition-all duration-300", "shadow-2xl")}
          style={{
            width: "220px",
            height: "220px",
            background:
              "radial-gradient(135deg, rgba(100, 180, 255, 0.3) 0%, rgba(70, 130, 180, 0.15) 50%, rgba(20, 40, 80, 0.6) 100%)",
            boxShadow:
              agentState === "connected"
                ? "0 0 80px rgba(100, 180, 255, 0.6), 0 0 120px rgba(30, 144, 255, 0.3), inset 0 0 60px rgba(100, 200, 255, 0.15)"
                : "0 0 40px rgba(100, 180, 255, 0.3), 0 0 60px rgba(30, 144, 255, 0.15), inset 0 0 40px rgba(100, 200, 255, 0.08)",
          }}
        >
          {/* Animated rotating gradient overlay */}
          <div
            className="absolute inset-0 rounded-full"
            style={{
              background:
                "conic-gradient(from 0deg, transparent 0deg, rgba(100, 180, 255, 0.4) 90deg, transparent 180deg)",
              animation: "spin 4s linear infinite",
            }}
          />

          {/* Inner reflective core */}
          <div
            className={cn(
              "absolute rounded-full",
              "top-1/4 left-1/4 w-1/3 h-1/3 blur-lg",
              agentState === "speaking" && "opacity-100",
              agentState === "connected" && "opacity-75",
              agentState !== "connected" && agentState !== "speaking" && "opacity-50",
            )}
            style={{
              background: "radial-gradient(circle, rgba(200, 230, 255, 0.8), transparent)",
              transition: "opacity 300ms ease-in-out",
            }}
          />
        </div>

        {/* Core pulse element */}
        <div
          className={cn(
            "absolute rounded-full transition-all duration-300",
            agentState === "speaking" && "animate-ping",
          )}
          style={{
            width: "180px",
            height: "180px",
            background:
              agentState === "connected"
                ? "radial-gradient(circle, rgba(150, 200, 255, 0.4), rgba(100, 150, 255, 0.1))"
                : "radial-gradient(circle, rgba(100, 160, 255, 0.25), rgba(70, 120, 200, 0.05))",
            boxShadow:
              agentState === "connected"
                ? "inset 0 0 40px rgba(150, 200, 255, 0.3)"
                : "inset 0 0 20px rgba(100, 160, 255, 0.1)",
          }}
        />
      </div>

      {/* Status text */}
      <div className="text-center">
        <p className="text-sm font-medium text-foreground">{DEFAULT_AGENT.name}</p>
        <p
          className={cn(
            "text-xs font-medium transition-colors duration-300",
            agentState === "connected" && "text-emerald-500",
            agentState === "connecting" && "text-amber-500",
            agentState === "speaking" && "text-blue-400",
            agentState === "disconnected" && "text-muted-foreground",
            (agentState === null || agentState === "disconnecting") && "text-muted-foreground",
          )}
        >
          {agentState === "connected"
            ? "Connected"
            : agentState === "connecting"
              ? "Connecting..."
              : agentState === "speaking"
                ? "Speaking..."
                : "Ready to chat"}
        </p>
      </div>

      <style jsx>{`
        @keyframes spin {
          from {
            transform: rotate(0deg);
          }
          to {
            transform: rotate(360deg);
          }
        }
      `}</style>
    </div>
  )
}

