  agentState?: AgentState
  volumeMode?: "auto" | "manual"
  manualInput?: number
  manualOutput?: number
  inputVolumeRef?: React.RefObject<number>
  outputVolumeRef?: React.RefObject<number>
  getInputVolume?: () => number
  getOutputVolume?: () => number
  className?: string
  size?: string
  animationDuration?: number
  inputLevel?: number
  outputLevel?: number
}

export function Orb({
  colors = ["#CADCFC", "#A0B9D1"],
  className,
  // reduced default main orb size
  size = "128px",
  animationDuration = 20,
  agentState,
  inputLevel = 0,
  outputLevel = 0,
}: OrbProps) {
  // Map the two-color array to SiriOrb's color object
  const colorObj = {
    c1: colors[0] ?? "#CADCFC",
    c2: colors[1] ?? "#A0B9D1",
    c3: colors[1] ?? "#A0B9D1",
    bg: "transparent",
