      : agentState === "talking"
      ? "speaking"
      : ""

  // Shorten animation when speaking for snappier feedback
  const computedAnimationDuration = agentState === "talking" ? Math.max(4, animationDuration / 3) : animationDuration

  return (
    <div className={cn("orb relative h-auto w-auto overflow-hidden rounded-full", stateClass, className)}>
