"use client";
import React from "react";
import { cn } from "@/lib/utils";

export type SiriOrbProps = {
  size?: string; // e.g. "128px"
  className?: string;
  colors?: { bg?: string; c1?: string };
  animationDuration?: number;
  inputLevel?: number; // 0..1
  outputLevel?: number; // 0..1
  agentState?: "listening" | "talking" | "thinking" | null;
  onClick?: () => void;
};

const SiriOrb: React.FC<SiriOrbProps> = ({
  size = "128px",
  className,
  colors,
  animationDuration = 20,
  inputLevel = 0,
  outputLevel = 0,
  agentState = null,
  onClick,
}) => {
  const defaultColors = { bg: "#f6fbff", c1: "#2563eb" }; // light background + blue accent
  const finalColors = { ...defaultColors, ...colors };

  const sizeValue = Number.parseInt(String(size).replace("px", ""), 10) || 128;

  // pick a small blur scaled to size and audio
  const baseBlur = Math.max(2, Math.min(24, sizeValue * 0.03));
  const audioEnergy = Math.max(0, Math.min(1, Math.max(inputLevel ?? 0, outputLevel ?? 0)));
  const blur = Math.max(1, baseBlur * (1 + audioEnergy * 0.9));
  const scale = 1 + Math.min(0.18, audioEnergy * 0.12) + (agentState === "talking" ? 0.06 : 0);

  const ariaLabel =
    agentState === "talking"
      ? "Agent is speaking"
      : agentState === "listening"
      ? "Agent is listening"
      : agentState === "thinking"
      ? "Agent is thinking"
      : "Orb";

  return (
    <div
      className={cn("siri-orb", className, onClick && "interactive")}
      role={onClick ? "button" : undefined}
      tabIndex={onClick ? 0 : undefined}
      onClick={onClick}
      onKeyDown={(e) => {
        if (!onClick) return;
        if (e.key === "Enter" || e.key === " ") {
          e.preventDefault();
          onClick();
        }
      }}
      aria-label={ariaLabel}
      style={
        {
          width: size,
          height: size,
          transform: `scale(${scale})`,
          // CSS variables for the inline style block below
          ["--orb-bg" as any]: finalColors.bg,
          ["--orb-accent" as any]: finalColors.c1,
          ["--orb-blur" as any]: `${blur}px`,
          ["--orb-duration" as any]: `${animationDuration}s`,
        } as React.CSSProperties
      }
    >
      <style>{`
        .siri-orb {
          display: inline-grid;
          place-items: center;
          border-radius: 50%;
          position: relative;
          overflow: hidden;
        }
        /* main blue radial only  no white rotating overlay */
        .siri-orb::before {
          content: "";
          position: absolute;
          inset: 0;
          border-radius: 50%;
          background: radial-gradient(circle at 40% 35%, var(--orb-accent) 0%, transparent 55%), var(--orb-bg);
          filter: blur(var(--orb-blur));
          transition: filter 120ms linear, transform 120ms linear;
        }
        .siri-orb.interactive {
          cursor: pointer;
        }
        .siri-orb:focus {
          outline: none;
          box-shadow: 0 0 0 4px rgba(37,99,235,0.16);
        }
        @media (prefers-reduced-motion: reduce) {
          .siri-orb::before {
            transition: none;
          }
        }
      `}</style>
    </div>
  );
};

export default SiriOrb;

